import React, {useEffect} from 'react';
import Routes from './routes';
import Routes2 from './routes2';

function App() {

  useEffect(() => {
    window.removeEventListener('scroll')
    return () => {
      console.log('unsubscribe')
    }
  }, [])
  return(
    <div>
      <h1>Welcome to Next.js!</h1>
    <Routes />
    </div>
  );
}

export default App;
